import numpy as np
import matplotlib.pyplot as plt
DT_CTRL = 0.01


class LatControlINDI:
  def __init__(self):
    self.reset()

  def reset(self):
    self.delayed_output = 0.

  def update(self, output_steer, RC=1):
    alpha = 1. - DT_CTRL / (RC + DT_CTRL)
    self.delayed_output = self.delayed_output * alpha + output_steer * (1. - alpha)

    return self.delayed_output


class OppositeINDI:
  def __init__(self):
    self.reset()

  def reset(self):
    self.delayed_output = 0.

  def update(self, output_steer, RC=1):
    alpha = 1. - DT_CTRL / (RC + DT_CTRL)
    self.delayed_output = self.delayed_output * alpha + output_steer * (1. - alpha)
    output = output_steer - (self.delayed_output - output_steer) * 2
    # self.delayed_output = self.delayed_output - (self.delayed_output - output_steer)

    return output


